import React, {useState, useEffect} from 'react';
import styled, { keyframes } from 'styled-components'
import {Carousel} from 'react-carousel-minimal'

//transform: translateX(100%);

const PhotoReelHolder = styled.div`
    width: 90vw;
    height: 70vh;
    padding: 13vh 5vw 17vh 5vw;
`
//justify-content: center;
// align-content: center;
// align-items: center;
//padding: 5vh 5vh 5vh 5vh;

const images = [
    {
        image: "https://drive.google.com/uc?export=view&id=1AOiG4_UVfnFP2RcO_9NIwEvIABlvkF6g",
        caption: "photo",
    },
    {
        image: require('../Images/3.jpg').default,
        caption: "photo",
    },
    {
        image: require('../Images/4.jpg').default,
        caption: "photo",
    },
    {
        image: require('../Images/5.jpg').default,
        caption: "photo",

    },
    {
        image: require('../Images/6.jpg').default,
        caption: "photo",
    },
]

var files = []

function Image() {

    function importAll(r) {
        // r.keys().map((item, index) => { 
        //     let i = {}
        //     i['image'] = '../Images/MainScroll' + item.replace('./', '')
        //     i['caption'] = "photo"
        //     images.push(i)});    
        // }
        return r.keys().map(r);
    }

    useEffect(() => {
        var f = importAll(require.context('../Images/MainScroll', false, /\.(png|jpe?g|svg)$/));
        f.forEach(element => {
            images.push({image: element, caption: "photo"})
        });
        files = f
        //console.log(files)
        console.log(images)
    })

    //console.log(images)

    return(
        <PhotoReelHolder>
           {/* <Carousel
                    data = {images}
                    height = "80vh"
                    width = "100vw"
                    dots = {true}
                    automatic = {true}
            />  */}
            <img src = {files[0]}></img>
        </PhotoReelHolder>
        // <div>
        //     <img src = {require('../Images/3.jpg').default}></img>
        // </div>
    );
}

export default Image
